import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expense = [
    {
      id: 1,
      title: "Food",
      amount: 250,
      date: new Date(2021, 12, 11),
    },
    {
      id: 1,
      title: "Rent",
      amount: 575,
      date: new Date(2021, 12, 1),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem
        title={expense[0].title}
        amount={expense[0].amount}
        date={expense[0].date}
      />
    </div>
  );
}

export default App;
